  false,\n\t\"url\": null,\n\t\"notes\": \"The following is a report of material covered
  during a workshop on cannon net trapping and banding held at the Swan Lake National
  Wildlife Refuge, Sumner, Missouri, on October 4th and 5th, 1962. This meeting was
  the outgrowth of a request by Mr. Harold Burgess, Manager of the Squaw Creek Refuge,
  that a training session on cannon net trapping be held for the benefit of Region
  3 Refuge Personnel. I use the word outgrowth for the meeting was attended by 39
  Bureau representatives from four regions , seventeen state personnel representing
  seven states, six people from the Missouri Cooperative Research Unit, and two representatives
  from net and cartridge supply firms.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
